import React from "react";
import Background from "./background.jpg";
import NavBar from "./navbar";
import issues from "./data";

class Home extends React.Component {
    constructor(props) {
        super(props);

        this.handleClick = this.handleClick.bind(this);
    }

    handleClick(event) {
        if(event.target.value === 'register'){
            this.props.history.push('/register');
        }
        if(event.target.value === 'overview'){
            this.props.history.push('/overview')
        }
    }

    setLocalStorage(){
        if(!localStorage.getItem("issues")){
            localStorage.setItem('issues', JSON.stringify(issues));
            localStorage.setItem('countIssues', JSON.stringify(issues.PtSituationElement.length));
            localStorage.setItem('loggedInAs', "GOA");
        }
    }

    render() {
        return (
            <div className="home">
                {this.setLocalStorage()}
                <img id="background" className="background_photo" src={ Background } alt="" />
                <NavBar />
                <div className="register_box" >
                    <h2 className="text-center text-white">Logget inn som: <b>{localStorage.getItem("loggedInAs")}</b></h2>
                    <br></br>
                    <br></br>
                    <div className="d-flex flex-row bd-highlight mb-2 justify-content-center">
                        <button onClick={this.handleClick} type="button" value="register" className="home-button btn btn-primary btn-lg p-2 flex-grow-1">Ny melding</button>;
                        <button onClick={this.handleClick} type="button" value="overview" className="home-button btn btn-primary btn-lg p-2 flex-grow-1">Aktive meldinger</button>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
